var tipuesearch = {"pages": [{'title': 'About', 'text': '本學期的電腦輔助設計實習, 要求每一位學員根據本 HW template 的格式建立個人的作業倉儲與網頁. \n \n 40923209 \n 網站倉儲:  https://github.com/nfu40923209/cad2021_hw \n 網站連結:  https://nfu40923209.github.io/cad2021_hw/content/index.html \n 其他與作者或作業相關資料說明或介紹 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Task', 'text': '', 'tags': '', 'url': 'Task.html'}, {'title': 'hwpages', 'text': '我的作法是利用同學提供的 github account 一個一個查詢，然後複製網址到作業網站工作區貼上同學的網站連結，沒提供 github account 的同學以學號代替。 \n cad2021 2b \n cad2b w2\xa0 github網站連結 40723126  40723126 40723135  40723135 40723217  40723217 40732331  s40732331 40823114  40823114 40823115  40823115 40823117  pyc40823117 40823119  40823119 40823122  40823122 40823127  40823127 40823146  40823146 40823148  40823148 40823215  40823215 40871106  40871106 40923201  40923201 40923203  youshin40923203 40923204  40923204 40923205  40923205 40923206  40923206-1 40923207  40923207 40923208  nfu40923208 40923209  nfu40923209 40923210  40923210 40923211  a40923211 40923212  40923212 40923213  40923213 40923214  40923214 40923216  40923216 40923217  40923217 40923218  40923218 40923219  nfu40923219 40923220  40923220 40923221  40923221 40923223  40923223 40923224  s40923224 40923225  40923225 40923226  40923226 40923227  40923227 40923228  40923228 40923229  40923229 40923230  40923230 40923231  40923231 40923232  40923232 40923233  40923233 40923234  40923234 40923235  40923235 40923236  40923236 40923237  40923237 40923238  40923238 40923239  40923239 40923240  40923240 40923241  40923241 40923242  40923242 40923243  40923243 40923244  40923244 40923245  40923245-1 40923246  40923246 40923247  40923247 40923248  40923248 40923249  40923249-1 40923250  40923250 40923251  40923251 40923252  40923252 40923253  40923253 40971220  40971220 40971227  40971227 \n cad2b w5\xa0 github倉儲連結 40723126  40723126 40723135  40723135 40723217  40723217 40732331  40732331 40823114  40823114 40823115  40823115 40823117  pyc40823117 40823119  40823119 40823122  40823122 40823127  40823127 40823146  40823146 40823148  40823148 40823215  40823215 40871106  40871106 40923201  40923201 40923203  youshin40923203 40923204  40923204 40923205  40923205 40923206  40923206-1 40923207  40923207 40923208  nfu40923208 40923209  nfu40923209 40923210  40923210 40923211  a40923211 40923212  40923212 40923213  40923213 40923214  40923214 40923216  40923216 40923217  40923217 40923218  40923218 40923219  nfu40923219 40923220  40923220 40923221  40923221 40923223  40923223 40923224  s40923224 40923225  40923225 40923226  40923226 40923227  40923227 40923228  40923228 40923229  40923229 40923230  40923230 40923231  40923231 40923232  40923232 40923233  40923233 40923234  40923234 40923235  40923235 40923236  40923236 40923237  40923237 40923238  40923238 40923239  40923239 40923240  40923240 40923241  40923241 40923242  40923242 40923243  40923243 40923244  40923244 40923245  40923245-1 40923246  40923246 40923247  40923247 40923248  40923248 40923249  40923249-1 40923250  40923250 40923251  40923251 40923252  40923252 40923253  40923253 40971220  40971220 40971227  40971227', 'tags': '', 'url': 'hwpages.html'}, {'title': 'HW1', 'text': 'HW1 佔學期成績 25% \n HW1 必須在 2021.11.10 22:00 之前完成. \n HW1 具體項目成果回報區 將於 2021.09.23 開啟, 於  2021.11.10 22:00 關閉. \n 作業一: meArm Robot 零件繪圖與機電運動模擬場景製作 \n Step1 : 下載  meARM.7z  這個包含尚未完成組立的 meArm Robot 場景與雷射切割零件組立手冊. \n meArm_75-0040_v1.pdf  則是另外一本組立參考手冊. \n Step2 : 從課程網頁中的  Compile CoppeliaSim 頁面 , 下載  coppeliaSim 4.1.0 官方版與 MSYS2 編譯版.7z  (檔案大小 412 MB, 解開壓縮後 1GB) 可攜套件. \n Step3 : 在 HW1 中, 要求每一位學員透過程式亂數分配 (兩班實際亂數分配結果以上課時點擊下列按鈕所得結果為準) 所使用的兩套參數式 CAD 套件, 從軟體發展緣起開始進行介紹,\xa0 經過教育版軟體套件檔案的取得, 下載安裝以及配置使用. 根據 Step1 中的零件尺寸, 逐一完成 meArm Robot 各零件繪製與組立. 並將零件 匯入  CoppeliaSim 進行組裝配置後, 以  UI 介面 中的 slider 控制 meArm Robot 各軸的旋轉作動. \n 2b CAD 套件分配結果:  https://mde.tw/cad2021/downloads/online/2b_hw1_cad.txt \n 附件: \n 1. CAD 套件分配表: \n sw: Solidworks, inv: Inventor, nx: NX12, ons: Onshape, slvs: Solvespace \n 2a 套件亂數分配結果 \n 2b 套件亂數分配結果 \n 2. 在兩套 CAD 完成零件繪圖並轉入 CoppeliaSim 後, 為了建立 Dynamic Model 必須利用  shape edit modes  轉為  clean model , 並與實際轉入的 STL 格式零件外形結合應用後建立模擬場景 (scenes). \n 3. meARM Robot  動態模擬場景 的建構, 可參考  0 ,  1 ,  2 ,  3 ,  4 ,  5 ,  6 ,  7 , 也可參考  Uarm Robot model  與相關 影片 . \n 4. CoppeliaSim design dynamic simulations  說明頁面 . \n 5.  網際 Lua  程式執行. \n 6.  meArm.slvs ,  meArm_in_solvespace.slvs \n 7. UI 介面程式參考: \n function closeEventHandler(h)\n    sim.addLog(sim.verbosity_scriptinfos,\'Window \'..h..\' is closing...\')\n    simUI.hide(h)\nend\n\nfunction joint1_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta1 set to \'..newVal)\n    sim.setJointTargetPosition(joint1, newVal*deg)\nend\n\nfunction joint2_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta2 set to \'..newVal)\n    sim.setJointTargetPosition(joint2, newVal*deg)\nend\n\nfunction joint3_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta3 set to \'..newVal)\n    sim.setJointTargetPosition(joint3, newVal*deg)\nend\n\nfunction joint16_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta16 set to \'..newVal)\n    sim.setJointTargetPosition(joint16, newVal*deg)\n    sim.setJointTargetPosition(joint20, -newVal*deg)\nend\n\nfunction sysCall_init()\n    -- do some initialization here\n    joint1 = sim.getObjectHandle(\'motor1\')\n    joint2 = sim.getObjectHandle(\'motor2\')\n    joint3 = sim.getObjectHandle(\'motor3\')\n    joint16 = sim.getObjectHandle(\'motor16\')\n    joint20 = sim.getObjectHandle(\'motor20\')\n    i = 0\n    deg = math.pi/180\n    print(i)\n    xml = [[\n<ui closeable="true" on-close="closeEventHandler" resizable="true">\n    <label text="This is a demo of the CustomUI plugin. Browse through the tabs below to explore all the widgets that can be created with the plugin." wordwrap="true" />\n    <tabs>\n        <tab title="Numeric">a\n            <label text="Sliders can be oriented horizontally or vertically, and have optional properties that can be set (in the XML) such as minimum and maximum value." wordwrap="true" />\n            <label text="" id="3000" wordwrap="true" />\n            <label text="theta1" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="360" on-change="joint1_rotate" />\n            <label text="theta2" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="65" on-change="joint2_rotate" />\n            <label text="theta3" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="185" on-change="joint3_rotate" />\n            <label text="theta16" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="15" on-change="joint16_rotate" />\n        </tab>\n    </tabs>\n</ui>\n]]\n    ui=simUI.create(xml)\n    \nend \n \n (From:  2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf ) \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'Solidworks\xa0繪圖', 'text': 'Solidworks 1993年到2019年的歷史介紹 \n 1993年 \n 創始人Jon Hirschtick，開發了SolidWorks。 \n 1995年 \n \n Solidworks與其他CAD系統的18,000美元相比，Solidworks的售價僅為4,000美元。 \n 該軟體更易於使用，易用性的很大一部份原因是它採用了現代著名的Windows介面。 \n 模型的可視化是前所未有的，在光線充足的陰影環境中的建構功能與傳統建模空間形成鮮明對比，傳統建模空間僅顯示黑色背景下的黑框。 \n 我們現在熟悉的類似FeatureManager用於顯示模型的構建歷史。 \n 零件、組件和圖紙從一開始就可用，用戶無法在組件中應用配合但仍可將組建放置到位。 \n \n 1996年 \n \n 介紹了上下建模，允許使用自上而下的裝配建模方法。 \n 用戶現在可以在裝配中使用配合並捕捉動態裝配運動，除了干擾檢測用戶還可以更輕鬆的驗證形狀、適合度和功能。 \n 拖放功能可將一個裝配體零部件移動到另一個裝配體中。 \n 部分配置 \n 自動化物料清單，只有一種方法沒有自定義選項，但它很有效。 \n \n 1997年 \n \n 板金功能首次發布。 \n 標準庫功能推出。 \n Loft功能現在可以使用引導曲線。 \n Solidworks被Dassault Systemes收購。 \n 面部圓角介紹。 \n 裝配配置 \n 完全可定製的組件爆炸視圖。 \n \n 1998年 \n \n 已發布功能面板，現在與設計庫的功能類似，可以拖放到模型上的預製功能。 \n 草圖診斷可幫助用戶理解草圖不適用於特定特徵的原因。 \n Lofts和Sweeps的相切控制。 \n 組合件封包Assembly Envelopes。 \n 智能配合在建造組件中更多的使用拖放式自動化。 \n 隨著用戶不斷建造越來越大的組件，輕量級組件可以幫助提高性能。 \n 表面處理工具首次推出。 \n FeatureWorks用於導入文件，能夠更有效的使用來自於其他軟體的現有3D數據。 \n 首次CSWP考試發布，它是手寫的，並通過郵件發送。 \n \n 1999年 \n \n Palm Springs的第一個Soliworks World。 \n 拖動組件時對組件的實時碰撞測驗。 \n 3D草圖介紹。 \n 管道模塊發布。 \n 2D命令模擬器有助於縮小與以前AutoCAD用戶的差距。 \n \n 2000年 \n \n 發布eDrawings。 \n 實現了Hole Wizard接口。 \n 表面處理更有用，能夠編織、修剪和延伸表面。 \n SolidWorks Explorer。 \n 動態間隙檢測可驗證裝配部分之間的最小間隙。 \n \n 2001年 \n \n 鏡像組件中的組件。 \n 引領互動，以前，在任何CAD系統中，只要選擇了命令，軟體就會在模型頂部顯示整個對話框，SolidWorks開始廢除這一點，並轉向我們現在知道的PropertyManagers，並將陰影標註返回到模型。 \n 現在允許靈活的子組件進一步捕捉準確的裝配運動。 \n 介紹填充表面命令。 \n DXF、DWG導入嚮導發布。 \n 3D會議，最終在幾個版本之後退出，利用Microsoft Live Meeting並允許與屏幕共享進行實時同步會議。 \n 運動模擬功能現在可以捕捉組件中移動的組件的實際物理動態。 \n 介紹大型裝配模式。 \n 實現了2D到3D轉換工具，以便將2D CAD數據輕鬆轉換為功能齊全的3D模型。 \n 介紹Solidworks Office，將常用的插件如PhotoWorks、Toolbox、Utilties和FeatureWorks打包成一個產品。 \n Dassault Systemes收購了SRAC並開始將仿真引入主流設計流程。 \n \n 2003年 \n \n COSMOSXpress是第一款Xpress產品，它為每個桌面帶來了簡單的零件驗證。 \n 3DContentCentral位用戶提供了一個交互和共享模型的社區。 \n 多體零件設計，這是一個非常大的問題，現在是焊接、鈑金和模具設計得基礎。 \n 收購了PDMWorks並引入了Solidworks Office Professional軟體包，開始將PDM作為每個客戶提供的一部分。 \n \n 2004年 \n \n 界面更新，包括CommandManager，彈出FeatureManager和PropertyManage和ConfigurationManager的管理器視圖選項卡。 \n 介紹了模具工具和焊件。 \n 實施Auto Balloon命令以匹配物料清單物料編號中的Balloon編號。 \n 限制配合以捕捉更複雜的裝配運動。 \n 推出了RealView Graphics，以便隨時提供更逼真的圖像。 \n \n 2005年 \n \n 繪圖比較，為用戶提供工具來比較兩個圖紙之間的變化。 \n Flex功能。 \n 電氣布線與管道布線一起使用。 \n 在圖紙中自動標註，以捕捉模型中已定義尺寸。 \n 能夠繪製無限線條。 \n SolidWorks Rx發布，旨在提供幫助技術支持更好地去識別問題。 \n \n 2006年 \n \n 發布Smart Components功能，允許為硬體之類的物件安裝智能裝配組件。 \n 介紹填充圖案。 \n 介紹草圖塊。 \n 顯示狀態。 \n 設計檢查器，允許用戶根據公司標準動態檢查他們的模型。 \n 添加了相機視圖功能。 \n 發布白金版軟體包，包括Rouring、COSMOSWorks和COSMOSMotion進行模型，以及ScanTo3D。 \n \n 2007年 \n \n SWIFT工具可幫助設計人員在提供自動化解決方案時動態了解模型存在問題或錯誤的原因。 \n 可在組件中使用皮帶、鏈條和齒輪功能。 \n 用於表面處理的自由形式命令。 \n 介紹Enterprise PDM。 \n \n 2008年 \n \n 使用新的菜單欄和CommandManager布局對用戶界面進行全面檢修和現代優化，上下工具欄和快捷工具欄首次可用，所有這些界面組件現在都可以完全自定義。 \n Instont3D，提供拖動和操縱幾何體的功能，可輕鬆測試不同的設計概念。 \n 發布TolAnalyst。 \n 設計剪貼畫，通過剖析現有數據以便在另一個模型中重複使用，可以更輕鬆地重用現有的2D和3D數據。 \n 推出DriveWorksXpress和DFMXpress。 \n \n 2009年', 'tags': '', 'url': 'Solidworks\xa0繪圖.html'}, {'title': 'Solidworks\xa0安裝配置', 'text': 'CAD1 指各學員所分配到的第一套參數式 CAD 套件, 其中包括 Solidworks, Inventor, NX, Onshape 與 Solvespace. \n CAD1 套件下載安裝與配置 \n CAD1 下載安裝與配置流程 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020 下載安裝與配置 」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n 由於安裝配置 Solidworks 時必須使用 nfu 的 vpn, 因此各學員必須按照 說明 , 完成本學期的 vpn 使用申請. \n Solidworks 分別提供 2017 與 2020 版本: \n SW2017 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n SW2020 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n NX12 版本: \n NX12 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n NX12 可攜版本下載 \xa0(必須先登入 @gm 帳號後才能下載) \n Inventor: \n 請在校園網路, 使用 nfu vpn 或設定系上代理主機, 就可以從  https://2019wcm.blogspot.com/2019/07/autodesk-inventor-professional.html  嘗試下載 autodesk.iso 後安裝 Inventor Professional 版本. \n Onshape: \n 至  https://www.onshape.com/en/  申請帳號後使用. \n Solvespace: \n 至  https://solvespace.com  下載或從  https://github.com/solvespace/solvespace  下載原始碼, 以可攜程式系統自行編譯後使用. \n', 'tags': '', 'url': 'Solidworks\xa0安裝配置.html'}, {'title': 'Solidworks\xa0操作流程', 'text': 'CAD1 指各學員所分配到的第一套參數式 CAD 套件, 其中包括 Solidworks, Inventor, NX, Onshape 與 Solvespace. \n CAD1 零組件繪圖操作流程影片 (Youtube) \n CAD1 零組件繪圖教學影片 (Wink) \n CAD1 零組件繪圖教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零組件繪圖教學影片」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n', 'tags': '', 'url': 'Solidworks\xa0操作流程.html'}, {'title': 'NX12\xa0繪圖', 'text': 'CAD2 指各學員所分配到的第二套參數式 CAD 套件, 其中包括 Solidworks, Inventor, NX, Onshape 與 Solvespace. \n CAD2 緣起說明與介紹 \n 請不要直接從找到的 CAD2 套件說明複製貼上, 而是應該要看完各種參考資料後, 重新打字彙整. \n', 'tags': '', 'url': 'NX12\xa0繪圖.html'}, {'title': 'NX12\xa0安裝配置', 'text': 'CAD2 指各學員所分配到的第二套參數式 CAD 套件, 其中包括 Solidworks, Inventor, NX, Onshape 與 Solvespace. \n CAD2 套件下載安裝與配置 \n CAD2 套件下載安裝與配置影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  套件下載安裝與配置影片」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n', 'tags': '', 'url': 'NX12\xa0安裝配置.html'}, {'title': 'NX12\xa0操作流程', 'text': 'CAD2 指各學員所分配到的第二套參數式 CAD 套件, 其中包括 Solidworks, Inventor, NX, Onshape 與 Solvespace. \n CAD2 零組件繪圖操作流程影片 (Youtube) \n CAD2 零組件繪圖教學影片 (Wink) \n CAD2 零組件繪圖教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零組件繪圖教學影片」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n', 'tags': '', 'url': 'NX12\xa0操作流程.html'}, {'title': '運動場景', 'text': 'CAD1: \n CAD1 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n CAD1 零件轉入 CoppeliaSim 教學影片 (Wink) \n CAD1 轉入 Coppeliasim 教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零件轉入 CoppeliaSim 教學影片」且加上 語音說明 與 字幕. \n CAD2: \n CAD2 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n CAD2 零件轉入 CoppeliaSim 教學影片 (Wink) \n CAD2 轉入 Coppeliasim 教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零件轉入 CoppeliaSim 教學影片」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n', 'tags': '', 'url': '運動場景.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'HW2', 'text': 'HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 請將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 請利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 並結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n 參考: \n 2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf \n Robot Manipulator Control with Inverse Kinematics PD-Pseudoinverse Jacobian and Forward Kinematics Denavit Hartenber.pdf \n KINEMATIC ANALYSIS FOR ROBOT ARM.pdf \n https://codebender.cc/user/MeArm \n https://github.com/mdecourse/meArmPi \n /downloads/MeArmPiTechnicalOverviewV0-3DRAFT.pdf \n https://github.com/mdecourse/me-arm-ik \n https://github.com/mdecourse/mearm_model \n https://courses.ece.cornell.edu/ece5990/ECE5725_Fall2016_Projects/pas324_ml634/index.html \n https://github.com/mdecourse/InefficientSkittleSorter \n https://mearm.com \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 請從上列 Tasks 中自行選擇項目內容完成 HW3. \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': 'Final Project 佔學期成績 40% \n 2a 與 2b 必須在 2022.01.06 上課之前完成 Final Project \n Final Project 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n 彈性製造系統場景設計與製作 \n 請從  https://github.com/mdecourse/scenes  與  https://github.com/mdecourse/models  中選擇場景或模型, 配合  cad2021_textbook.pdf  (登入 @gm 帳號後下載) 教材中的內容, 自選製作與組立產品, 組合成一個 Flexible Manufacturing System 系統場景. \n 彈性製造系統內容說明 \n 範例: \n \n \n', 'tags': '', 'url': 'Final Project.html'}, {'title': 'run', 'text': ' 導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n', 'tags': '', 'url': 'run.html'}]};